import {Injectable} from "@angular/core";
import {HttpClient} from "@angular/common/http"
import {map, tap} from "rxjs";

@Injectable()

export class CarsServise {
  constructor(private http: HttpClient) { }

  getCars() {
    return this.http
      .get('http://localhost:3000/cars')
      .pipe(map((response) => {
        return response
      }),tap((res) => {
        return res
      }))
  }
}
